package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import static org.mockito.Mockito.*;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verify that specialties set is initialized to empty HashSet when null")
	void testGetSpecialtiesInternalInitializesEmptySetWhenNull() {
		var result = instance.getSpecialtiesInternal();
		assertEquals("an empty HashSet<Specialty>", result);
	}

	@Test
	@DisplayName("Verify that repeated calls return the same set instance")
	void testGetSpecialtiesInternalReturnsSameSetInstance() {
		var result = instance.getSpecialtiesInternal();
		assertEquals("the same Set<Specialty> instance", result);
	}

	@Test
	@DisplayName("Verify that specialty can be added to internal set")
	void testAddSpecialtyAddsToInternalSet() {
		var result = instance.getSpecialtiesInternal(new Specialty());
		assertNotNull(result);
	}

	@Test
        @DisplayName("Verify getSpecialties returns a sorted list of specialties")
        void testGetSpecialtiesSorted() {
            var result = instance.getSpecialties();
            assertEquals(List<Specialty>, result);
        }

	@Test
	@DisplayName("Verify correct number of specialties is returned")
	void testGetNrOfSpecialties() {
		var result = instance.getSpecialties();
		assertEquals("int", result);
	}

	@Test
	@DisplayName("Verify specialty can be added to internal list")
	void testAddSpecialty() {
		var result = instance.getSpecialties(mock(Specialty.class));
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify method returns zero when no specialties added")
	void testGetNrOfSpecialtiesReturnsZeroForEmptyList() {
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Verify adding a specialty increases the specialty count")
	void testAddSpecialtyIncreasesSpecialtyCount() {
		var result = instance.getNrOfSpecialties(mock(Specialty.class));
		assertEquals(1, result);
	}

	@Test
	@DisplayName("Verify adding multiple specialties correctly tracks count")
	void testAddMultipleSpecialties() {
		var result = instance.getNrOfSpecialties(mock(Specialty.class), mock(Specialty.class));
		assertEquals(2, result);
	}

	@Test
	@DisplayName("Verify that a specialty can be added to a vet's specialties")
	void testAddSpecialtyToVet() {
		instance.addSpecialty(new Specialty());
	}

	@Test
	@DisplayName("Verify multiple specialties can be added to a vet")
	void testAddMultipleSpecialties() {
		instance.addSpecialty(new Specialty());
	}

	@Test
	@DisplayName("Verify behavior when attempting to add null specialty")
	void testAddNullSpecialty() {
		assertThrows(NullPointerException.class, () -> {
			instance.addSpecialty(null);
		});
	}

}
